             "keytakeofflocationaltitude",
             "<b>参数: </b>double  飞行器起飞时的海拔高度，单位为米。 <i>msdk 5.0.0开始支持</i></code>",
             "keyflightlogindex",
             "<b>参数: </b>integer  获取当前飞行日志的索引，当需要查找相应的飞行日志时非常有用。 <i>msdk 5.0.0开始支持</i></code>",
             "keyserialnumber",
             "<b>参数: </b>string  获取飞控序列号。 <i>msdk 5.0.0开始支持</i></code>",
             "keyfirmwareversion",
             "<b>参数: </b>string  获取飞控固件版本。 <i>msdk 5.0.0开始支持</i></code>",
             "keygpssatellitecount",
             "<b>参数: </b>integer  获取gps卫星个数。通常在高空飞行能达到12颗星以上，时段良好时能达到18~19颗。 <i>msdk 5.0.0开始支持</i></code>",
             "keygpssignallevel",
             "<b>参数: </b>`gpssignallevel`  获取gps信号等级。 <i>msdk 5.0.0开始支持</i></code>",
             "keycompasscount",
             "<b>参数: </b>integer  获取指南针个数。 <i>msdk 5.0.0开始支持</i></code>",
             "keycompassheading",
             "<b>参数: </b>double  获取指南针朝向，单位：度。正北为0度，正东为90度，范围：[-180,180]。 <i>msdk 5.0.0开始支持</i></code>",
             "keycompasshaserror",
             "<b>参数: </b>boolean  `true`表示指南针数据错误。当飞行器在强干扰或磁场区域使用时，可能出现指南针数据错误。你需要调用`keystartcompasscalibration`进 行指南针校准。 <i>msdk 5.0.0开始支持</i></code>",
             "keystartcompasscalibration",
             "启动指南针校准。确保飞行器附近没有磁铁或金属物体，并把飞行器置于离地1.5米左右操作。你可以通过`keycompasscalibrationstatus`获取校 准状态。 以下是指南针校准的操作流程，以m30为例： - 1. 调用`keystartcompasscalibration`启动指南针校准，`compasscalibra tionstate`会变成水平校准状态`horizontal`，参考下图水平旋转飞行器360度进行水平校准。 <img src=https://terra-1-g.djicdn.com/71a7d383e71a4fb8887a310eb746b47f/msdk/api- doc/h.jpg>  - 2. 水平校准成功后，`compasscalibrationstate`会变成垂直校准状态`vertical`，参考下图垂直旋转飞行器360度进行垂直校准。   <img src=https://terra-1-g.djicdn.com/71a7d383e71a4fb8887a310eb746b47f/msdk /api-doc/v.jpg> - 3. 校准成功后，`compasscalibrationstate`会变成校准成功状态`succeeded`。 <b>注意：  请勿在飞行器电机起转后启动指南针校准。可通过`keyaremotorson`判断飞行器电机是否起转。</b> <i>msdk 5.0.0开始支持</i></code>",
             "keystopcompasscalibration",
             "停止指南针校准。 <i>msdk 5.0.0开始支持</i></code>",
             "keyiscompasscalibrating",
             "<b>参数: </b>boolean  `true`表示正在进行指南针校准。 <i>msdk 5.0.0开始支持</i></code>",
             "keycompasscalibrationstatus",
             "<b>参数: </b>`compasscalibrationstate`  获取指南针校准状态。 <i>msdk 5.0.0开始支持</i></code>",
             "keyimucount",
             "<b>参数: </b>integer  获取imu个数。 <i>msdk 5.0.0开始支持</i></code>",
             "keystartimucalibration",
             "启动imu校准。对于具有多个imu的飞行器，此方法将进行所有imu的校准。 建议在imu校准后调用`keyrebootdevice`重启设备。 以下是imu校准的操作流程： - 1. 调用`keystartimucalibration`启动imu校准，通过监听`keyimucalibrationinfo `获取imu校准信息。`imucalibrationstate`变成校准中`calibrating`则表示成功启动imu校准。  - 2. 调用`getorientationstocalibrate`获取未校准的飞机方向列表。参考`imucalibrationorientation`中的 图示，依次摆放飞机进行单个飞机方向的imu校准，在校准过程中保持飞行器静止和水平。  - 3. 调用`getorientationcalibrationstate`获取单个飞机方向的imu校准状态，当校准状态变成`successful`再摆放下一个方向。  - 3. 当未校准的飞机方向列表`getorientationstocalibrate`为空的时候，`getorientationcalibrationsta te`获取到的总体校准状态变成校准成功状态`successful`则表示imu校准已完成。 <b>注意：  请勿在飞行器电机起转后启动imu校准。可通过`keyaremotorson`判断飞行器电机是否起转。</b> <i>msdk 5.0.0开始支持</i></code>",
             "keyimucalibrationinfo",
             "<b>参数: </b>`imucalibrationinfo`  获取imu校准信息。imu校准包含多个飞机方向的imu校准，imu校准信息包括imu总体校准状态，每个飞机方向的校准状态以及未校准的飞行方向列表和已校准飞机方 向列表。 <i>msdk 5.1.0开始支持</i></code>",
             "keyultrasonicheight",
             "<b>参数: </b>integer  获取超声波测距高度。该高度为飞机起飞后，从上往下测量的距离。单位：分米，最大可测距离为25.5米。 <i>msdk 5.0.0开始支持</i></code>",
             "keywindwarning",
