             "<b>参数: </b>integer  获取当前风速，单位：dm/s。 <i>msdk 5.0.0开始支持</i></code>",
             "keywinddirection",
             "<b>参数: </b>`winddirection`  获取当前风向，采用世界坐标系。 <i>msdk 5.0.0开始支持</i></code>",
             "keymultipleflightmodeenabled",
             "<b>参数: </b>boolean  `true`表示允许切换飞行器的飞行模式。用户可以通过拨动遥控器上的三段选择开关将飞行器的飞行模式`keyflightmode`设置为t三脚架、a姿态、p(n )定位、s运动模式。 如果设置为`false`，飞行器将一直处于p(n)定位模式,不可被更改。 <i>msdk 5.0.0开始支持</i></code>",
             "keyremotecontrollerflightmode",
             "<b>参数: </b>`remotecontrollerflightmode`  获取遥控器档位模式。 <i>msdk 5.0.0开始支持</i></code>",
