             "<b>参数: </b>`flightmode`  获取飞行器的飞行模式。 <i>msdk 5.1.0开始支持</i></code>",
             "keyisfailsafe",
             "<b>参数: </b>boolean  `true`表示飞行器失控中，即将进行失控行为。 <i>msdk 5.0.0开始支持</i></code>",
             "keyfailsafeaction",
             "<b>参数: </b>`failsafeaction`  设置和获取失控行为。当遥控器和飞行器失去连接的时候，飞行器将按照设置的失控行为进行操作。 <i>msdk 5.0.0开始支持</i></code>",
             "keylowbatterywarningthreshold",
             "<b>参数: </b>integer  设置和获取电池低电量警告的阈值。该数值为百分比，范围：[15,50]。当电池电量低于该阀值时，飞行器将进行低电量报警。 <i>msdk 5.0.0开始支持</i></code>",
             "keyislowbatterywarning",
             "<b>参数: </b>boolean  `true`表示当前电池处于低电量状态。 <i>msdk 5.0.0开始支持</i></code>",
             "keyseriouslowbatterywarningthreshold",
             "<b>参数: </b>integer  获取电池严重低电量警告的阈值。该值默认为10%，matrice 30 series不可设置。当电池电量低于该阀值时，飞行器将进行返航操作。 <i>msdk 5.0.0开始支持</i></code>",
             "keyisseriouslowbatterywarning",
             "<b>参数: </b>boolean  `true`表示当前电池处于严重低电量状态。 <i>msdk 5.0.0开始支持</i></code>",
             "keyledssettings",
             "<b>参数: </b>`ledssettings`  led相关设置。支持前臂灯、状态指示灯、夜航灯的设置。 <i>msdk 5.0.0开始支持</i></code>",
             "keyaremotorson",
             "<b>参数: </b>boolean  `true`表示电机起转。 <i>msdk 5.0.0开始支持</i></code>",
             "keylockmotors",
             "<b>参数: </b>boolean  `true`表示锁住电机，掰杆后电机将不会转动。 <i>msdk 5.0.0开始支持</i></code>",
             "keyescbeepenabled",
             "<b>参数: </b>boolean  `true`表示开启电调鸣叫功能。当飞行器不慎失联，可开启此功能，通过声音辨别飞行器方位。如果当前电机已起转，请停转电机再试。 <i>msdk 5.0.0开始支持</i></code>",
             "keycoordinatedturnenabled",
             "<b>参数: </b>boolean  `true`表示开启协调转弯功能。飞行器转弯时机头跟随飞行方向，没有侧滑的飞行，飞行阻力更小。 <i>msdk 5.0.0开始支持</i></code>",
             "keynavigationsatellitesystemsource",
             "<b>参数: </b>`navigationsatellitesystem`  设置使用的卫星定位系统，仅在rtk定位功能关闭下支持设置卫星定位系统，飞行器在空中无法进行修改。切换卫星定位系统后，请确认卫星信号`level_3`以上再起飞 。如果你开启了rtk定位功能，飞控会同时使用gps、glonass、galileo和北斗卫星定位系统。 <i>msdk 5.0.0开始支持</i></code>",
             "keystarttakeoff",
             "启动飞行器自主起飞。当飞行器悬停在离地面1.2米（4英尺）的高度时表示起飞完成。如果电机已经开启，将无法执行此命令。 <i>msdk 5.0.0开始支持</i></code>",
             "keystoptakeoff",
             "停止飞行器自主起飞。如果在自主起飞完成之前调用此接口，飞行器将取消起飞并悬停在当前高度。如果已经自主起飞已经完成，将无法执行此命令。 <i>msdk 5.0.0开始支持</i></code>",
             "keystartautolanding",
             "启动飞行器自主降落。 <i>msdk 5.0.0开始支持</i></code>",
             "keystopautolanding",
             "停止飞行器自主降落。如果在自主降落过程中调用此接口，飞行器将会停止自主降落，并且悬停在当前位置。 <i>msdk 5.0.0开始支持</i></code>",
             "keyislandingconfirmationneeded",
