             "keyconfirmlanding",
             "确认继续降落着陆。当飞行器与地面的距离小于0.7m时，飞行器将暂停着陆，等待用户确认。 可以通过`keyislandingconfirmationneeded`来检查是否需要确认降落。 <i>msdk 5.0.0开始支持</i></code>",
             "keyrebootdevice",
             "重启飞行器的核心设备。建议在imu校准后调用此方法。 <b>注意：  请勿在飞行器电机起转后重启飞行器的核心设备。可通过`keyaremotorson`判断飞行器电机是否起转。</b> <i>msdk 5.0.0开始支持</i></code>",
             "keyheightlimitrange",
