             "keystartmultigimbalsynccontrol",
             "<b>参数: </b>`multigimbalsynccontrolinfo`  开启多云台联动控制。可以通过一个遥控器同时控制多个云台，请确保设置的云台已经挂载到飞行器上， 此接口适用于可以挂载多个云台的飞行器，比如m300 rtk和m350 rtk。 <i>msdk 5.2.0开始支持</i></code>",
