             "keyishomelocationset",
             "<b>参数: </b>boolean `true`表示返航点已设置。当gps信号良好时，飞行器会自动把当前飞行器位置设置为返航点，此时`keyishomelocationset`将返回`true`。 <i>msdk 5.0.0开始支持</i></code>",
             "keyhomelocation",
             "<b>参数: </b>`locationcoordinate2d`  设置和获取当前返航点的位置，包括经纬度。当gps信号良好时，飞行器会自动把当前飞行器位置设置为返航点，你也可以使用这个key改变返航点位置。 <i>msdk 5.0.0开始支持</i></code>",
             "keygohomeheight",
             "<b>参数: </b>integer  设置和获取返航时的相对高度，单位：米。此相对高度是相对于起飞时的高度。可通过`keygohomeheightrange`获取返航高度设置范围。  如果飞行器水平距离返航点50米内，飞行器将忽略设置的返航高度，以飞行器当前高度返航。如果此时前视视觉系统未正常工作，飞行器将上升到预设的高度进行返航。 <i>msdk 5.0.0开始支持</i></code>",
             "keygohomeheightrange",
             "<b>参数: </b>`intvalueconfig`  获取返航高度设置范围，单位：米。 <i>msdk 5.0.0开始支持</i></code>",
             "keyhomelocationusingcurrentaircraftlocation",
             "将飞行器的当前位置设置为返航点位置。 <i>msdk 5.0.0开始支持</i></code>",
             "keystartgohome",
             "启动智能返航。当gps信号不好的时候，不可启动智能返航功能。 你也可以通过遥控器智能返航按键启动智能返航，返航过程用户可通过油门杆控制飞行器高度和俯仰杆控制飞行 器速度以躲避障碍物。返航过程中，通过遥控器上的智能返航按键或者调用`keystopgohome`退出智能返航后，用户可重新获得飞行器控制权。你可以通过`keyg ohomestatus`获取智能返航状态。 <i>msdk 5.0.0开始支持</i></code>",
             "keystopgohome",
             "停止智能返航。 <i>msdk 5.0.0开始支持</i></code>",
             "keygohomestatus",
             "<b>参数: </b>`gohomestate`  获取智能返航状态。 <i>msdk 5.0.0开始支持</i></code>",
             "keylowbatteryrthenabled",
             "<b>参数: </b>boolean  `true`表示开启智能低电量返航功能。为防止因电池电量不足而出现不必要的危险，飞行器将会根据飞行的位置信息，智能地判断当前电量是否充足。若当前电量仅够完成返 航过程，msdk将提示是否需要执行返航。若用户在10秒内不作选择，则10秒后飞行器将自动进入返航。返航过程中可短按遥控器智能返航按键取消返航过程。智能低电量返航 在同一次飞行过程中仅出现一次。如果用户取消低电量返航提醒并继续飞行，将可能导致飞行器返回时电量不足而迫降，造成飞行器丢失或坠毁。为了安全起见，不建议关闭此功能。 <i>msdk 5.0.0开始支持</i></code>",
             "keygohomeassessment",
             "<b>参数: </b>`lowbatteryrthinfo`  获取智能低电量返航相关信息。仅在`keylowbatteryrthenabled`开启后有效。 <i>msdk 5.0.0开始支持</i></code>",
             "keyaccesslockeralldevicestatus",
             "<b>参数: </b>list<`accesslockerdevicestatus`>  获取存储设备的安全密码状态。可通过此接口获取飞行器上的存储设备是否支持安全密码功能，是否开启安全密码功能以及是否需要验证安全密码。 安全密码是为了保护您的媒体数据安全。设置安全密码后，msdk app连接飞行器后需要进行密码校验，验证通过后才可以进行拍照录像以及读写存储设备中的媒体数据。 - `getisfeaturesupported`为`true`，表示该存储设备支持安全密码功能。你可以调用`keyaccesslockersetsecurit ycode`设置安全密码。  - `getisfeatureenabled`为`true`，表示该存储设备的安全密码功能已开启。你可以调用`keyaccesslockermodifysec uritycode`进行安全密码修改。如果你忘记了安全密码，你可以调用`keyaccesslockerresetsecuritycode`重置安全密码。  - `getisfeatureneedtobeverified`为`true`，表示该存储设备需要验证安全密码。请调用`keyaccesslockerveri fysecuritycode`进行安全密码验证，否则将无法进行拍照录像，并且无法读写存储设备中的媒体数据。当飞行器重启或者存储设备拔插后通常需要验证安全密码。  - dji不会在设备上存储用户密码，也不会回传dji。  - 用户忘记密码后，不支持找回密码。如您不慎遗失安全密码，只能通过格式化的方式来解锁存储设备。  - 安全密码仅支持禅思h20系列相机，m30系列机型相机及mavic 3行业系列相机，暂不支持禅思 p1、禅思 l1以及其他第三方负载。 <i>msdk 5.1.0开始支持</i></code>",
             "keyaccesslockersetsecuritycode",
             "<b>参数: </b>`accesslockersetsecuritycodeinfo`  设置安全密码。可通过此接口选择设备和存储类型进行安全密码设置。 - 设置安全密码后存储设备将被格式化，请确认媒体数据已备份。  - 请妥善保管安全密码，遗失后将无法找回，只能通过格式化的方式来解锁存储设备。  - 你设置的密码长度需要至少4位，建议使用数字,大写、小写字母组成密码。 <i>msdk 5.1.0开始支持</i></code>",
             "keyaccesslockerverifysecuritycode",
             "<b>参数: </b>`accesslockerverifysecuritycodeinfo`  校验安全密码。可通过此接口校验安全密码，验证通过后才可以进行拍照录像以及读写存储设备中的媒体数据。 <i>msdk 5.1.0开始支持</i></code>",
             "keyaccesslockermodifysecuritycode",
             "<b>参数: </b>`accesslockermodifysecuritycodeinfo`  修改安全密码。 <i>msdk 5.1.0开始支持</i></code>",
             "keyaccesslockerresetsecuritycode",
             "<b>参数: </b>`accesslockerresetsecuritycodeinfo`  重置安全密码。重置安全密码将会格式化存储设备，请确认媒体数据已备份。 <i>msdk 5.1.0开始支持</i></code>",
             "keyairsensesysteminformation",
             "<b>参数: </b>`airsensesysteminformation`  获取 dji airsense 系统的信息。包含警告级别和检测到的飞机（安装了 airsense 系统的载人飞行器，譬如民航、直升机等，简称飞机）的详细状态。  dji airsense 仅在特定情况下发出附近飞机的警告，它不会控制 dji 飞行器自动避开其他飞机。请确保您的飞行器始终在视线范围内飞行并始终谨慎飞行。收到警告后，将飞行器降低到安全高度。此外，dji airsense 有以下限制：  - dji airsense 只能接收 1090es（rtca do-260）或 uat（rtca do-282）标准下配备 ads-b 输出设备的飞机发送的信息。对于没有 ads-b 输出或 ads-b 输出故障的飞机，dji airsense 无法接收相关广播信息或发出警告。  - 当飞机与 dji 飞行器之间有障碍物时，dji 飞行器将无法接收到飞机发送的 ads-b 信息或告警。  - dji airsense 可能会因环境变化和干扰而收不到飞机发送的 ads-b 信息或发出警告。强烈建议谨慎飞行，并在飞行过程中注意周围环境。  - dji airsense 无法在 dji 飞行器无法准确定位时发出警告。  - dji airsense 在禁用或配置错误时无法接收飞机发送的 ads-b 消息或发出警告。 <i>msdk 5.5.0开始支持</i></code>",
