             "上传航线任务。 - 航线任务定义在kmz文件中，kmz文件采用dji自定义的航线文件格式（wpml）进行编写。 wpml格式遵循xml和kml规范，更详细信息请参阅：<a href=https://developer.dji.com/doc/cloud-api- tutorial/cn/api-reference/dji-wpml/overview.html>航线文件格式</a>。  - 用户可根据dji pilot 2中提供的模板生成航线文件，也可使用dji wpml格式根据业务需要自定义waylines.wpml中的内容，并将该文件压缩为kmz文件后上传。  - 你可以多次调用此接口上传多个航线任务kmz文件，如果上传相同的文件名的kmz文件，将会覆盖上一次上传的同名文件。  - 你可以通过设置航线任务kmz文件名来选择航线任务的执行`startmission`和停止`stopmission`。  - 一个kmz文件包括一个航线任务，一个航线任务里面可以包含多个航线。 <i>msdk 5.0.0开始支持</i></code>  @param missionfilepath 航线任务kmz文件路径。 @param callback 返回执行结果的回调。返回kmz文件上传状态，包括上传进度和错误信息。",
