             "开始执行指定断点的航线任务。可通过`querybreakpointinfofromaircraft`查询上一次航线任务暂停时的断点信息。获取到断点信息以后可以作 为参数传入到此接口，飞行器将飞往传入的断点位置，然后按航点顺序依次执行航线任务。如果你不希望从上一次暂停时的飞行器位置开始执行航线任务，你也可以自行构造断点信息 ，设置任意航点位置开始执行航线任务。 <b>注意：  1. m300 rtk和m350 rtk不支持断点续飞功能。  2. 暂停航线任务后，只有退出航线任务，才能调用此接口重新执行航线任务。通用的应用场景包括：航线任务执行完成后返航降落或者飞行器重新上电。  3. 如果你希望在不退出航线任务的前提下，从指定的断点位置开始飞行。你可以调用`resumemission`恢复执行航线任务。</b> <i>msdk 5.6.0开始支持</i></code>  @param missionfilename 执行的航线任务文件名。 @param breakpointinfo 断点信息 @param callback 返回执行结果的回调。",
