                   "#IVirtualStickManager_enableVirtualStick_inline",
                   "开启虚拟摇杆模式。 <b>注意：  1. 出于飞行安全考虑，飞行器在靠近限飞区或者限远距离30米时，遥控器会夺取飞行器控制权，虚拟摇杆功能无法使用。  2. 目前只有 M300 RTK，M350 RTK和M30 系列飞行器支持在虚拟摇杆模式下避障。  3. 虚拟摇杆普通模式默认支持避障。  4. 虚拟摇杆高级模式下只有在垂直方向控制模式是速度模式，偏航轴控制模式是角速度并且横滚和俯仰轴控制模式是速度模式的组合下才支持避障。  </b> <i>MSDK 5.0.0开始支持</i></code>  @param callback 返回执行结果的回调。",
