                   "<b>参数: </b>Boolean  启用或禁用等温线。开启等温线功能可以更直观地看出指定温度区间的物体。通过高温、低温两个阈值来设置温度区间。等温线禁用时，所有256个值（8位）都用于场景的温度 直方图。启用等温线后，只有128个值（0-127）与温度线性映射。然后将三个颜色区间（128-175）、（176-223）和（224-255）映射到用户定义的温 度，以向用户突出显示它们。使用一些调色板（例如`RAINBOW`）会生成灰度级的热图像，红色、蓝色或绿色将用于突出显示的三个特定的温度。 <b>注意：  1. 要使用此功能，请调用`KeyCameraVideoStreamSource`把视频源设置为`INFRARED_CAMERA`。  2. 使用`KeyTools`创建`DJIKey<T>`实例的时候，把`CameraLensType`设置为`CAMERA_LENS_THERMAL`。</b> <i>MSDK 5.0.0开始支持</i></code>",
